import React from 'react';

function Menu() {
  return (
    <nav style={styles.nav}>
      <div style={styles.logo}>MiAplicaci√≥n</div>
      <ul style={styles.navLinks}>
        <li><a href="#inicio" style={styles.link}>Inicio</a></li>
        <li><a href="#servicios" style={styles.link}>Servicios</a></li>
        <li><a href="#contacto" style={styles.link}>Contacto</a></li>
      </ul>
    </nav>
  );
}

const styles = {
  nav: {
    position: 'sticky',
    top: 0,
    width: '100%',
    backgroundColor: '#1a1a1a',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '16px 32px',
    zIndex: 1000,
    boxShadow: '0 2px 4px rgba(255, 255, 255, 0.05)',
  },
  logo: {
    color: '#ffffff',
    fontSize: '1.5rem',
    fontWeight: 'bold',
  },
  navLinks: {
    listStyle: 'none',
    display: 'flex',
    gap: '24px',
    margin: 0,
    padding: 0,
  },
  link: {
    color: '#e0e0e0',
    textDecoration: 'none',
    fontSize: '1rem',
    transition: 'color 0.3s ease',
  },
};

export default Menu;
